import Apcard from "./apcard";

function Landing() {
    return (
        <div>
            <div>
                <form>
                    <label></label>
                </form>
            </div>
            <div style={styles.container}>
                <Apcard
                    heading="Uplinks"
                    count="2/3"
                    status="Healthy"
                />
                <Apcard
                    heading="Uplinks"
                    count="2/3"
                    status="Poor"
                />
            </div>
        </div>
    );
}

export default Landing;

const styles = {
    container: {
        display: 'grid',
        gridTemplateColumns: 'repeat(3, 1fr)', 
        gap: '20px',
        marginTop: '20px',
    },
    card: {
        border: '1px solid #ddd',
        borderRadius: '8px',
        boxShadow: '0 2px 8px rgba(0, 0, 0, 0.29)',
        padding: '15px',
        flex: 1,
    },
};
